import React from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
import './App.css';
import {data} from './Datastore.js'
import { unstable_batchedUpdates } from 'react-dom';

function App() {
  const [searchTerm, setSearchTerm] = React.useState("");
  const handleChange = event => {
    setSearchTerm(event.target.value);
  };

  const results = !searchTerm
    ? data
    : data.filter(pagename =>
        pagename.toLowerCase().includes(searchTerm.toLocaleLowerCase())
      );

  return (
    <div className="Panel1">
      <input
        type="text"
        placeholder="Search"
        value={searchTerm}
        onChange={handleChange}
        id="DirectorySearch" class="Searchbar"
      />
      <ul>
        {results.map((key,value) => (
          <li class="lirender">  <a class="Linktext"href={key.Direct}> {key.Pagename} </a> </li>
        ))}
      </ul>
    </div>
  );
}




export default App;
